import React, { useState, useEffect } from "react";
import "../styles/app.css";

const Home = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [selectedLanguage, setSelectedLanguage] = useState("English");
  const [isNavOpen, setIsNavOpen] = useState(false);
  const [lastScrollY, setLastScrollY] = useState(0);
  const [isScrollingUp, setIsScrollingUp] = useState(true);
  const [isHeaderVisible, setIsHeaderVisible] = useState(true);
  const [isNavVisible, setIsNavVisible] = useState(true);
  const [isActionsVisible, setIsActionsVisible] = useState(true);

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
    if (!isDropdownOpen) {
      setIsNavOpen(true); // Close the nav when dropdown is opened
    }
    if (isNavOpen) {
      setIsNavOpen(false); // Close the nav when dropdown is opened
    }
    if (isScrollingUp) {
      setIsScrollingUp(true); // Close the nav when dropdown is opened
    }
  };

  const toggleNav = () => {
    setIsNavOpen(!isNavOpen);
  };

  const toggleHeader = () => {
    setIsHeaderVisible(!isHeaderVisible);
  };

  const handleScroll = () => {
    const currentScrollY = window.scrollY;
    if (currentScrollY > lastScrollY) {
      setIsScrollingUp(false); // Scrolling down
    } else {
      setIsScrollingUp(true); // Scrolling up
    }
    setLastScrollY(currentScrollY);
  };

  const toggleNavVisibility = () => {
    setIsNavVisible(!isNavVisible);
  };

  const toggleActions = () => {
    setIsActionsVisible(!isActionsVisible);
  };

  useEffect(() => {
    window.addEventListener("scroll", handleScroll);
    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, [lastScrollY]);

  const languages = ["English", "Spanish", "French", "German", "Chinese", "Japanese", "Korean", "Russian", "Arabic"];

  const handleLanguageSelect = async (language) => {
    setSelectedLanguage(language);
    setIsDropdownOpen(false);
    console.log(language);

    try {
      const response = await fetch("https://your-backend-server.com/api/language", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ language }),
      });

      if (response.ok) {
        console.log("Language posted successfully!");
      } else {
        console.error("Failed to post language.");
      }
    } catch (error) {
      console.error("Error posting language:", error);
    }
  };

  return (
    <div className="">
      <button onClick={toggleNavVisibility} className="toggle-nav-btn">
        {isNavVisible ? "Hide Nav" : "Show Nav"}
      </button>
      <button onClick={toggleActions} className="toggle-actions-btn">
        {isActionsVisible ? "Hide Actions" : "Show Actions"}
      </button>
      <header className="header">
        <div className="logo">
          <a href="/" className="logo-link">
            MAX<span className="highlight">PAIN</span>
          </a>
        </div>
        {isNavVisible && (
          <nav className="nav">
            <a href="#attorneys">Friends</a>
            <a href="/investor">Investors</a>
            <a href="/attorneys">Attorneys</a>
            <a href="/about">About</a>
            <a href="/careers">Careers</a>
          </nav>
        )}
        {isActionsVisible && (
          <div className="actions">
            <a href="/contact-us" className="help-link">help</a>
            <a href="/Login" className="help-link">Log In</a>
            <a href="/signup" className="join-btn">Join MAX</a>
          </div>
        )}
      </header>
      <main className="main">
        <div className="hero">
          <div className="branding">
            <div className="hero-content">
              <h1 className="hero-title">
                <span className="hero-max">M</span>
                <span className="hero-axpain">AXPAIN</span>
              </h1>
              <div className="hero-line"></div>
              <div className="hero-subtext">MEDICAL ATTORNEY EXCHANGE</div>
            </div>
            <p className="branding-subtitle">
              Connecting you to the right people when things go left.
            </p>
          </div>
        </div>
      </main>
      <div className="bottom-right-logo">
        <img src="/images/app-logo.png" alt="Logo" />
      </div>
    </div>
  );
};

export default Home;
